import React from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";

const Navbar = () => {
  return <nav>
    <Link to="/">
      ホーム
    </Link>
    <Link to="/search">
      検索
    </Link>
  </nav>;
};

export default Navbar;
